import React, { Component } from "react";
import Header from "./components/Header";
import Main from "./pages/main";
import { Container, Typography } from "@material-ui/core";

class App extends Component {
  render() {
    return (
      <Container className="App">
        <Header />
        <Main />
      </Container>
    );
  }
}

export default App;
